import React from 'react'
import TodoList from './components/todoList'
import Form from './components/form'
import './App.css'
const App = () => {
  let demotodos=[
    {
      id:1,
      todo:"Coding"
    },
    {
      id:1,
      todo:"Learn React"
    },
    {
      id:1,
      todo:"Orientation program"
    },
    {
      id:1,
      todo:"Painting"
    },
    {
      id:1,
      todo:"Shopping"
    }
  ]

  return (
    <div className='mainbox'>
      <h1>Todo-List</h1>
      <Form/>
      <TodoList Demotodos={demotodos} />
    </div>
  )
}

export default App
